1	ru	0	\N	Функции технического заказчика	технический заказчик, функции технического заказчика	Предоставление услуг по выполнению функций технического заказчика на крупных жилых и нежилых объектах недвижимости Москвы и Московской области	Функции технического заказчика			funkczii-tehnicheskogo-zakazchika	t	\N	f	2015-12-22 17:17:10.663031+03	2016-04-04 16:31:16.211656+03	<ul class="push m-b-3">\n\n    <li>разработка задания на проектирование;</li>\n\n    <li>получение Градостроительного Плана Земельного Участка;</li>\n\n    <li>организация инженерных изысканий;</li>\n\n    <li>получение технических условий на присоединение к инженерным сетям;</li>\n\n    <li>сопровождение экспертизы Проектной документации и ее утверждение;</li>\n\n    <li>получение разрешения на строительство;</li>\n\n    <li>сопровождение сдачи законченного строительством объекта и получение ЗОС;</li>\n\n    <li>получение разрешения на ввод объекта в эксплуатацию;</li>\n\n    <li>постановка на кадастровый учет;</li>\n\n    <li>разработка и утверждение специальных технических условий;</li>\n\n    <li>согласование перепланировок и изменения функционального назначения помещений.</li>\n\n</ul>\n\n<ul class="push">\n\n    <li>проверка соблюдения технологии производства СМР и сроков строительства;</li>\n\n    <li>проверка достоверности документирования результатов работ;</li>\n\n    <li>освидетельствование скрытых работ и промежуточная приемка возведенных строительных конструкций;</li>\n\n    <li>проверка соответствия фактически выполненных объемов;</li>\n\n    <li>проверка соответствия законченного строительством объекта требованиям проектной документации и технических\n\n        регламентов;\n\n    </li>\n\n    <li>осуществление иных видов работ по строительному контролю.</li>\n\n</ul>	{% load proj_images %}\n\n<p>\n\n    Одним из основных направлений деятельности ГК «ССК» является выполнение <strong>функций технического\n\n    заказчика</strong>, в том числе, осуществление <strong>строительного контроля</strong>.\n\n</p>\n\n<p>\n\n    Специалисты ГК «ССК» имеют большой опыт выполнения <b>функций заказчика</b> на стадии строительства, в задачи\n\n    которых входит решение любых организационных вопросов &mdash; от получения разрешения на строительство до ввода\n\n    объекта в эксплуатацию.\n\n</p>\n\n<p>\n\n    При осуществлении <b>строительного контроля</b> сотрудники ГК «ССК» осуществляют надзор за всеми стадиями\n\n    строительного процесса, дают конкретные рекомендации по устранению нарушений, выявленных техническим, авторским и\n\n    государственным строительным надзором. Заказчики своевременно информируются о выявленных нарушениях.\n\n    {% thumb 'www/stroitelnyj-kontrol/00.jpg' '480' class='img-fluid bg-cover overflow-x m-t-2' lazy='canvas' lightbox='content' %}\n\n</p>\n\n<h2 id="ctrl-quality">Контроль качества строительно-монтажных работ</h2>\n\n<h4>Контроль качества</h4>\n\n<p>\n\n    Инженеры группы компаний «ССК» осуществляют ежедневный мониторинг строительно-монтажных работ на объекте, принимая\n\n    непосредственное участие в сдаче-приемке всех выполненных этапов работ. Контроль качества подразумевает как\n\n    виртуальный осмотр, так и проведение необходимых испытаний непосредственно на площадке строительства, в том числе и\n\n    в лабораторных условиях. В ходе мониторинга выполняется сверка фактически выполненных работ с решениями, принятыми в\n\n    рабочей документации.\n\n</p>\n\n<p>\n\n    Стоит отметить, что <b>контроль качества работ</b> и выявление нарушений может производиться совместно с Авторским\n\n    надзором. По результатам ежедневного мониторинга инженерами <b>строительного контроля</b> подготавливаются такие\n\n    документы, как реестр не устраненных &mdash; генподрядчиком замечаний, реестры полученной и исполнительной рабочей\n\n    документации, накопительные ведомости, фото-отчеты, предписания и уведомления подрядным организациям.\n\n</p>\n\n<h4>Контроль качества СМР</h4>\n\n<p>\n\n    Обеспечивает высокий <b>контроль качества строительства</b> &mdash; предотвращает деформации и обрушения конструкций\n\n    зданий, возникающие уже в первые годы эксплуатации объекта, а зачастую обнаруживаемые еще до сдачи объекта в\n\n    эксплуатацию. Позволяет исключить скрытые дефекты конструкций и других инженерных сетей, обнаружение которых на\n\n    этапе эксплуатации здания невозможно или затруднено, и сопряжено со значительными дополнительными расходами на\n\n    обследование здания.\n\n</p>\n\n<h4>Контроль соблюдения графиков строительно-монтажных работ</h4>\n\n<p>\n\n    Именно <b>контроль утвержденных сроков</b> выполнения строительно-монтажных работ является одной из основных функций\n\n    специалистов строительного контроля. Не стоит говорить о том, насколько важно соблюдение сроков при строительстве\n\n    объектов жилой, коммерческой или промышленной недвижимости.\n\n</p>\n\n<p>\n\n    В первую очередь, срыв запланированных графиков приводит к значительному удорожанию стоимости строительства, в\n\n    особенности если были задействованы кредитные средства.\n\n</p>\n\n<p>Существует ряд основных мероприятий ГК «ССК» по контролю соблюдения сроков строительно-монтажных работ:</p>\n\n<ul class="push">\n\n    <li>Сверка условий договоров подряда с утвержденным проектной документацией объемом работ;</li>\n\n    <li>Анализ соответствия графика работ с утвержденным объемом работ и их порядком на основании таких документов как:\n\n        <ul>\n\n            <li>проект организации строительства;</li>\n\n            <li>проект производства работ и др.</li>\n\n        </ul>\n\n    </li>\n\n    <li>Ежедневный контроль соблюдения утвержденных графиков непосредственно на строительной площадке.</li>\n\n</ul>\n\n<h2 id="ctrl-enter">Входной контроль</h2>\n\n<p>\n\n    К сожалению, практически на любой строительной площадке можно столкнуться с тем, что подрядные организации, вопреки\n\n    рабочей документации, закупают более дешевые строительные материалы.\n\n</p>\n\n<p>\n\n    На данном этапе, в первую очередь осуществляется проверка поступающих на объект строительных материалов, и готовых\n\n    конструкций.\n\n</p>\n\n<p>\n\n    Контролируется <em>качество материалов</em>, их количество и комплектность, а также условия хранения на строительной\n\n    площадке. Помимо этого, осуществляется обязательная проверка <em>сопроводительной документации на\n\n    материалы</em> &mdash; сертификаты, технические паспорта, товарные накладные, результаты исследований.\n\n</p>\n\n<p>Проверка поступающих на площадку материалов и оборудования осуществляется по следующим критериям:</p>\n\n<ul class="push">\n\n    <li>Визуальный осмотр и проверка комплектности продукции;</li>\n\n    <li>Приемка сопроводительной документации на продукцию, которая, помимо транспортной (отгрузочной) документации,\n\n        может включать в себя технические, эксплуатационные и разрешительные документы (сертификаты, разрешения,\n\n        свидетельства экспертизы);\n\n    </li>\n\n    <li>Приемка по количеству;</li>\n\n    <li>Соответствие маркировок проектно-сметной документации;</li>\n\n    <li>Оценка качества не только путем визуального осмотра, но и с использованием специализированного оборудования.\n\n    </li>\n\n</ul>\n\n<h2 id="ctrl-docs">Контроль документации</h2>\n\n<p>\n\n    На протяжении выполнения строительно-монтажных работ подрядные организации оформляют исполнительную документацию,\n\n    которая в последующем анализируется и визируется специалистами строительного контроля.\n\n</p>\n\n<p>\n\n    Комплект исполнительной документации включает в себя исполнительные геодезические схемы и акты приемки геодезической\n\n    разбивки, общие и специальные журналы работ, схемы сетей инженерных коммуникаций, акты приемки конструкций,\n\n    результаты испытаний работоспособности инженерных систем и оборудования, результаты лабораторных исследований,\n\n    рабочие чертежи (включающие данные о реально выполненных работах) и другие документы. Вся работа службы\n\n    строительного контроля основывается на разработанном комплекте рабочей документации. Данная документация тщательно\n\n    проверяется по аспектам комплектности, достаточности, информативности и содержания.\n\n</p>\n\n<p>\n\n    После проверки рабочей документации наличия положительного заключения <em>Государственной экспертизы</em>, она\n\n    передается в производство работ.\n\n</p>\n\n<p>\n\n    Порядок оформления <em>исполнительной документации</em> строго регламентируется действующим законодательством\n\n    Российской Федерации. В комплект исполнительной документации входят документы, подтверждающие фактическое выполнение\n\n    работ и их соответствие рабочей документации. Наряду с проверкой качества строительно-монтажных работ, инженеры\n\n    строительного надзора также выполняют мониторинг исполнительной документации на предмет ее комплектности и\n\n    соответствия реальному положению. При сдаче объекта в эксплуатацию данный комплект исполнительной документации\n\n    должен быть предоставлен инспекторам Строительного надзора для проверки и помещения прав.\n\n    {% thumb 'www/stroitelnyj-kontrol/01.jpg' '480' class='img-fluid bg-cover overflow-x m-t-2' lazy='canvas' lightbox='content' %}\n\n</p>	1	1
4	ru	3	\N	Проектные работы	проект, проектирование	Организация и выполнение всех видов проектных работ для жилых и нежилых объектов недвижимости Москвы и Московской области	Проектные работы	Проектирование		proektnye-raboty	t	\N	f	2015-12-22 18:21:38.050341+03	2016-05-16 17:37:53.269997+03	<ul class="push">\n\n    <li>архитектурное проектирование;</li>\n\n    <li>разработка конструктивных решений;</li>\n\n    <li>проектирование внутренних и наружных инженерных систем;</li>\n\n    <li>авторский надзор;</li>\n\n    <li>разработка дизайн-проектов.</li>\n\n</ul>	<p>\n\n   Группа компаний «ССК» занимается проектной деятельностью более 15 лет. Специалистами компании «ССК-Проект», входящей\n\n   в группу компаний «ССК», разработано и реализовано значительное количество <b>проектов жилых и общественных\n\n   зданий</b> различного уровня сложности, что позволяет решать разнообразные задачи в области проектирования с высоким\n\n   качеством и с строгим соблюдением сроков выполнения работ.\n\n</p>\n\n<p>\n\n   Высокий уровень подготовки и многолетний опыт работы сотрудников позволяет решать любые творческие задачи, находить\n\n   архитектурные решения, наиболее точно отражающие самые неожиданные и смелые желания заказчика.\n\n</p>\n\n<p>\n\n   «ССК-Проект» включает в себя группу архитектурного проектирования, конструкторский отдел, группу специалистов по\n\n   <b>проектированию инженерных систем</b>, отдел дизайна и авторского надзора за реализацией проектов.\n\n</p>\n\n<p>\n\n   Специалисты проектного отдела владеют всеми новейшими методами проектирования, а современное техническое оснащение\n\n   офиса позволяет успешно работать над сложнейшими объектами.\n\n</p>\n\n<p>\n\n   «ССК-Проект» обладает допуском к работам, оказывающим влияние на безопасность объектов капитального\n\n   строительства.\n\n</p>\n\n<p>\n\n   Использование Группой компаний «ССК» современных стандартов качества гарантирует безопасность, актуальность и\n\n   уникальность Вашего проекта.\n\n</p>	1	1
