3	2	\N	Строительный контроль при монолитных работах	строительный контроль, монолитные работы	Перечень основных требований строительного контроля при осуществлении монолитных работ на крупных жилых и нежилых объектах недвижимости Москвы и Московской области	Строительный контроль <small>при монолитных работах</small>	Строительный контроль при монолитных работах		stroitelnyj-kontrol-pri-monolitnyh-rabotah	t	\N	f	2016-02-18 01:38:01.967976+03	2016-04-12 17:25:07.373728+03	{% load proj_images %}\n\n<p>\n\n    Инженеру <strong>строительного контроля</strong>, осуществляющему контроль за строительством объектов\n\n    жилищно-гражданского и производственного назначения,по основным видам нарушений при <strong>монолитных\n\n    работах</strong>.\n\n</p>\n\n<h2>Перечень основных строительных нарушений (дефектов) при производстве монолитных работ</h2>\n\n{% with size='192' lazy='canvas' class='img-fluid' lightbox='stroitelnyj-kontrol' itemprop=True %}\n\n<table class="table table-condensed">\n\n    <caption>Монолитные бетонные работы</caption>\n\n    <thead>\n\n    <tr>\n\n        <th width="56">№ <br> п/п</th>\n\n        <th>Нарушения обязательных требований нормативных документов в строительстве</th>\n\n        <th width="25%">Ссылки на нормативные документы</th>\n\n        <th width="25%">Фото (образец нарушения)</th>\n\n    </tr>\n\n    </thead>\n\n    <tbody>\n\n    <tr>\n\n        <td>1</td>\n\n        <td>Перед укладкой бетонной смеси не производится очистка горизонтальных и наклонных бетонных поверхностей\n\n            рабочих швов от мусора, масел, снега, льда и др., поверхности не промываются водой и не просушиваются.\n\n        </td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.3.1 (СНиП 3.03.01-87, п.&nbsp;2.8)</td>\n\n        <td>\n\n            {% with alt='укладка бетонной смеси без очистки рабочих швов' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/00.jpg' %}\n\n            {% endwith %}\n\n            {% with alt='укладка бетонной смеси без промывки водой и просушивания поверхности' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/01.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>2</td>\n\n        <td>Укладка бетонной смеси в конструкции производится не горизонтальными слоями, не одинаковой толщины, с\n\n            разрывами.\n\n        </td>\n\n        <td>СНиП 3.03.01-87, п.&nbsp;2.10 (СП 70.13330.2012 п.&nbsp;5.3.8)</td>\n\n        <td>\n\n            {% with alt='неравномерная укладка бетонной смеси в конструкции' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/02.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>3</td>\n\n        <td>Укладка бетона следующего слоя бетонной смеси производится на бетон предыдущего слоя, процесс схватывания\n\n            которого начался, верхний уровень уложенной бетонной смеси доходит до верха щитов опалубки менее нормируемых\n\n            значений.\n\n        </td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.3.9 (СНиП 3.03.01-87, п.&nbsp;2.12)</td>\n\n        <td>\n\n            {% with alt='укладка бетона следующего слоя производится на бетон предыдущего слоя' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/03.jpg' %}\n\n            {% endwith %}\n\n            {% with alt='верхний уровень бетонной смеси доходит до верха опалубки менее нормируемых значений' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/04.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>4</td>\n\n        <td>Поверхность рабочих швов, устраиваемых при укладке бетонной смеси с перерывами, не перпендикулярна оси\n\n            бетонируемых колонн, балок, поверхности плит и стен; расположение рабочих швов не соответствует проекту.\n\n        </td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.3.12 (СНиП 3.03.01-87, п.&nbsp;2.13)</td>\n\n        <td>\n\n            {% with alt='расположение рабочих швов не соответствует проекту' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/05.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>5</td>\n\n        <td>Не выполняются требования к укладке и уплотнению бетонных смесей. Движение людей по забетонированным\n\n            конструкциям и установка опалубки вышележащих конструкций производится до достижения бетоном нормируемой\n\n            прочности.\n\n        </td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.3.13, табл. 5.2 (СНиП 3.03.01-87, п.&nbsp;2.14., табл.&nbsp;2)</td>\n\n        <td>\n\n            {% with alt='не выполняются требования к укладке и уплотнению бетонных смесей' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/06.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>6</td>\n\n        <td>Движение людей по забетонированным конструкциям и установка опалубки вышележащих конструкций производится до\n\n            достижения бетоном нормируемой прочности.\n\n        </td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.4.3 (СНиП 3.03.01-87, п.&nbsp;2.17)</td>\n\n        <td>\n\n            {% with alt='движение людей по забетонированным конструкциям' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/07.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>7</td>\n\n        <td>Не контролируются основные показатели качества бетонной смеси и бетона.</td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.6.5, табл.&nbsp;5.3 (СНиП 3.03.01-87, п.&nbsp;2.23., табл.&nbsp;3)</td>\n\n        <td>\n\n            {% with alt='строительный контроль основных показателей качества бетонной смеси и бетона' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/08.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>8</td>\n\n        <td>Состояние основания, на которое укладывается бетонная смесь, а также температура основания и способ укладки\n\n            не исключают возможности замерзания смеси в зоне контакта с основанием; неопалубленные поверхности\n\n            конструкций не укрыты паро- и теплоизоляционными материалами по окончании бетонирования; выпуски арматуры\n\n            забетонированных конструкций не укрыты, не утеплены на нормируемую высоту (длину).\n\n        </td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.11.5 (СНиП 3.03.01-87, п.&nbsp;2.57)</td>\n\n        <td>\n\n            {% with alt='не исключена возможность замерзания бетонной смеси в зоне контакта с основанием' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/09.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>9</td>\n\n        <td>Не осуществляется контроль прочности бетона испытаниями образцов, изготовленных у места укладки бетонной\n\n            смеси, либо по температуре бетона в процессе его выдерживания.\n\n        </td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.5.5 (СНиП 3.03.01-87, п.&nbsp;2.61)</td>\n\n        <td>\n\n            {% with alt='не осуществляется контроль прочности бетона испытаниями образцов' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/10.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>10</td>\n\n        <td>Не выполняются нормативные требования к производству бетонных работ при отрицательных температурах\n\n            воздуха.\n\n        </td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.11.16, табл.&nbsp;5.7 (СНиП 3.03.01-87, п.&nbsp;2.62., табл.&nbsp;6)</td>\n\n        <td>\n\n            {% with alt='не выполняются нормативные требования к производству бетонных работ' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/11.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>11</td>\n\n        <td>Не осуществляется уход за свежеуложенным бетоном после окончания укладки бетонной смеси до достижения\n\n            нормативной прочности при температуре воздуха выше нормируемой температуры.\n\n        </td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.4.1 (СНиП 3.03.01-87, п.&nbsp;2.66)</td>\n\n        <td>\n\n            {% with alt='не осуществляется уход за свежеуложенным бетоном' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/12.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>12</td>\n\n        <td>Минимальная прочность бетона при распалубке менее нормативной.</td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.17.8, табл.&nbsp;5.11 (СНиП 3.03.01-87, п.&nbsp;2.110., табл.&nbsp;10)</td>\n\n        <td>\n\n            {% with alt='строительный контроль минимальной прочности бетона' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/13.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>13</td>\n\n        <td>Не соблюдены требования, предъявляемые к законченным бетонным и железобетонным конструкциям или частям\n\n            сооружений.\n\n        </td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.18.3, табл.&nbsp;5.12 (СНиП 3.03.01-87, п.&nbsp;2.113., табл.&nbsp;11)</td>\n\n        <td>\n\n            {% with alt='не соблюдены требования, предъявляемые к законченным конструкциям' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/14.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>14</td>\n\n        <td>Стыковые и крестообразные сварные соединения выполнены с отступлениями от проекта.</td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.16.22 (СНиП 3.03.01-87, п.&nbsp;2.103)</td>\n\n        <td>\n\n            {% with alt='строительный контроль выполнения соединений в соотвесвии с проектом' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/15.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>15</td>\n\n        <td>Превышены предельно допустимые отклонения при устройстве арматурных конструкций.</td>\n\n        <td>СП 70.13330.2012 п.&nbsp;5.16.16, табл.&nbsp;5.10 (СНиП 3.03.01-87, п.&nbsp;2.104., табл.&nbsp;9)</td>\n\n        <td>\n\n            {% with alt='превышение предельно допустимых отклонений' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/16.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>16</td>\n\n        <td>Сварка арматуры произведена ручной дуговой электросваркой с подрезкой стержней рабочей арматуры.</td>\n\n        <td>ГОСТ 14098-91; п.&nbsp;8.</td>\n\n        <td>\n\n            {% with alt='строительный контроль сврки арматуры' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/3/17.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    </tbody>\n\n</table>\n\n{% endwith %}	1	1	1
4	3	\N	Строительный контроль при производстве земляных работ	строительный контроль, земляные работы	Перечень основных требований строительного контроля при производстве земляных работ на крупных жилых и нежилых объектах недвижимости Москвы и Московской области	Строительный контроль <small>при производстве земляных работ</small>	Строительный контроль при земляных работах		stroitelnyj-kontrol-pri-proizvodstve-zemlyanyh-rabot	t	\N	f	2016-02-18 01:39:56.145277+03	2016-04-12 17:25:21.571733+03	{% load proj_images %}\n\n<p>\n\n    Инженеру <strong>строительного контроля</strong>, осуществляющему контроль за строительством объектов\n\n    жилищно-гражданского и производственного назначения,по основным видам нарушений при производстве <strong>земляных\n\n    работ</strong>.\n\n</p>\n\n<h2>Перечень основных строительных нарушений (дефектов) при производстве земляных работ</h2>\n\n{% with size='192' lazy='canvas' class='img-fluid' lightbox='stroitelnyj-kontrol' itemprop=True %}\n\n<table class="table table-condensed">\n\n    <caption>Земляные работы</caption>\n\n    <thead>\n\n    <tr>\n\n        <th width="56">№ <br> п/п</th>\n\n        <th>Нарушения обязательных требований нормативных документов в строительстве</th>\n\n        <th width="16.667%">Ссылки на нормативные документы</th>\n\n        <th width="16.667%">Контролируемые параметры</th>\n\n        <th width="16.667%">Предельные отклонения</th>\n\n        <th width="25%">Фото (образец нарушения)</th>\n\n    </tr>\n\n    </thead>\n\n    <tbody>\n\n    <tr>\n\n        <td>1</td>\n\n        <td>Земляные сооружения, основания и фундаменты не соответствуют проекту и выполняются с отклонениями от проекта\n\n            производства работ.\n\n        </td>\n\n        <td>СП 45.13330.2012 п.&nbsp;4.3 (СНиП 3.02.01-87, п.&nbsp;1.7)</td>\n\n        <td></td>\n\n        <td></td>\n\n        <td>\n\n            {% with alt='земляные сооружения, основания и фундаменты не соответствуют проекту' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/4/00.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>2</td>\n\n        <td>Замена предусмотренных проектом грунтов, материалов, изделий и конструкций, входящих в состав возводимого\n\n            сооружения или его основания произведена без согласования с проектной организацией и заказчиком.\n\n        </td>\n\n        <td>СП 45.13330.2012 п.&nbsp;4.6 (СНиП 3.02.01-87, п.&nbsp;1.8)</td>\n\n        <td></td>\n\n        <td></td>\n\n        <td></td>\n\n    </tr>\n\n    <tr>\n\n        <td rowspan="15">3</td>\n\n        <td rowspan="15">Не выполняются нормативные требования по водопонижению, организации поверхностного стока и\n\n            водоотвода\n\n        </td>\n\n        <td rowspan="15">СП 45.13330.2012 п.&nbsp;5.1-п.&nbsp;5.53, (СНиП 3.02.01-87, п.&nbsp;2.1.-п.&nbsp;2.19)</td>\n\n        <td></td>\n\n        <td></td>\n\n        <td rowspan="11">\n\n            {% with alt='нормативные требования по водопонижению, организации поверхностного стока и водоотвода' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/4/01.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr class="noborder">\n\n        <td>1.&nbsp;Контрольное давление воды при проверке герметичности системы трубопроводов</td>\n\n        <td>Выше расчетного значения не менее чем на 50%</td>\n\n    </tr>\n\n    <tr>\n\n        <td>2.&nbsp;Уклон трубопроводов иглофильтровых установок:</td>\n\n        <td>Не менее:</td>\n\n    </tr>\n\n    <tr class="noborder">\n\n        <td>всасывающих:</td>\n\n        <td>0.005 от насоса;</td>\n\n    </tr>\n\n    <tr class="noborder">\n\n        <td>напорных распределительных:</td>\n\n        <td>0.001 от насоса;</td>\n\n    </tr>\n\n    <tr class="noborder">\n\n        <td>водосборных:</td>\n\n        <td>0.005 в сторону циркуляционного бака;</td>\n\n    </tr>\n\n    <tr>\n\n        <td>3.&nbsp;Фильтры водопонизительных скважин:</td>\n\n        <td>Не допускаются обрывы нитей, неплотные стыки, трещины и др.;</td>\n\n    </tr>\n\n    <tr>\n\n        <td>4.&nbsp;Отклонение продольного уклона водоотводных канав от проектного значения:</td>\n\n        <td>Не более &plusmn;0,0005;</td>\n\n    </tr>\n\n    <tr>\n\n        <td>5.&nbsp;Концентрация химических веществ и взвесей в воде, сбрасываемой в естественные водотоки и водоемы:\n\n        </td>\n\n        <td>Не более предельно допустимых концентраций, установленных проектом;</td>\n\n    </tr>\n\n    <tr>\n\n        <td>6.&nbsp;Контроль работы водопонизительных установок:</td>\n\n        <td>По данным заводского паспорта на оборудование и проекта;</td>\n\n    </tr>\n\n    <tr>\n\n        <td>7.&nbsp;Контроль за положением статического и динамического уровней воды в скважинах:</td>\n\n        <td>Согласно проекта;</td>\n\n    </tr>\n\n    <tr>\n\n        <td>8.&nbsp;Отклонения уклона спланированной поверхности от проектного, кроме орошаемых земель:</td>\n\n        <td>Не должны превышать &plusmn;0.001 при отсутствии замкнутых понижений;</td>\n\n        <td rowspan="4">\n\n            {% with alt='состояние откосов и дна котлованов и траншей' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/4/02.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    <tr>\n\n        <td>9.&nbsp;Отклонения отметок спланированной поверхности от проектных, кроме орошаемых земель:</td>\n\n        <td></td>\n\n    </tr>\n\n    <tr class="noborder">\n\n        <td>а)&nbsp;в нескальных грунтах:</td>\n\n        <td>&plusmn;5 см;</td>\n\n    </tr>\n\n    <tr class="noborder">\n\n        <td>б)&nbsp;в скальных грунтах:</td>\n\n        <td>От +10 до -20 см;</td>\n\n    </tr>\n\n    <tr>\n\n        <td>4</td>\n\n        <td>Восполнение переборов в местах устройства фундаментов и укладки трубопроводов выполнено непроектным грунтом,\n\n            без уплотнения до плотности грунта естественного сложения\n\n        </td>\n\n        <td>СП 45.13330.2012 п.&nbsp;6.1.8 (СНиП 3.02.01-87, п.&nbsp;3.8)</td>\n\n        <td></td>\n\n        <td></td>\n\n        <td>\n\n            {% with alt='места устройства фундаментов и укладки трубопроводов' %}\n\n            {% thumb 'www/stroitelnyj-kontrol/4/03.jpg' %}\n\n            {% endwith %}\n\n        </td>\n\n    </tr>\n\n    </tbody>\n\n</table>\n\n{% endwith %}	1	1	1
