827	Liluunasor	kara.b.u.nbab.arun.m.a.runah@gmail.com		как считать ежемесячный платеж по кредиту	Вопросец о распространенности подобной диковины на рынке опять вызвал противоречия. Ира Кажикина («Релайт-Недвижимость») категорически заявила, что информация устаревшая: подобные фокусы были распространены до кризиса 2008 года, но на данный момент их нет. А в пресс-службе Сбербанка напомнили, что банк контролирует не только лишь сумму, обозначенную в отчете об оценке, да и в договоре купли-продажи. Прочие эксперты оказались наиболее аккуратными в оценках: самым частым ответом оказалось «нечасто, но бывает».\n\nПримечательно, что с инициативой «приукрасить» отчет к заемщику иногда обращаются сами оценщики: мол, давайте нам 3000 рублей, и мы нарисуем вам красиво. Банки, конечно, фильтруют оценочные компании, с которыми работают. «Отчет от заемщика предоставляется только от аккредитованной банком оценочной компании, - говорит Сергей Ситин, начальник управления розничного кредитования Промсвязьбанка. – Аккредитация означает, что банк проверил деятельность компании, в том числе и ее репутацию, и доверяет ей определять цена закладываемого в банк неподвижного имущества. Оценочные компании, обычно, дорожат своей репутацией и стараются не допускать предоставление недостоверных данных своим партнерам».\n\nИ все таки такое случается. Общение потенциального заемщика происходит совсем не с руководителем восхитительной аккредитованной компании, а с рядовым исполнителем, и о чем они там условятся – бог весть.\n\nА самое любознательное – дальнейшая судьба отчета. Дело в том, что необходимость в нем – требование закона «Об ипотеке», и банку такой документ не особенно-то нужен. Поэтому, получив отчет о оценке (с любыми цифрами – хоть действительными, хоть завышенными), банк традиционно оценивает квартиру своими силами. Проще говоря, его сотрудник открывает базу данных по продажам квартир и находит там самые дешевые из подобных вариантов. И в завышении цены отказывает. Так что отлично и банку (знает настоящую стоимость собственного залога), и оценщику (получил дополнительный «гонорар»). Не чрезвычайно отлично, правда, заемщику – издержал 3000 руб. совершенно зря. Но не нужно было взятку давать!\nЖК Купавна\nСкидка до 3500/кв.м. либо кладовая в подарок. Квартиры от 1,3 млн руб. Горьковское ш. Окончание строительства 2017 г от 1,3 млн руб. Узнать телефон\n\nПотребительский кредит под видом ипотечного\nБанковских товаров существует масса – о этом сегодня малыши малые знают. И также всем понятно, чем ипотечные кредиты лучше всех прочих – они одни из самых прибыльных для заемщика. И ставки минимальные (по сравнению с прочими), и сроки самые длинные. Поэтому те граждане, которым необходимы просто средства (т.е. потребительский кредит), пробуют получить ипотечный.\n\nРассказывая об этой теме, почти все банки выразили искреннее недоумение: вот у нас есть нецелевые кредиты под залог имеющейся недвижимости, таким методом совершенно легально можно получить средства на что угодно! Это, конечно, правда, относительно этих продуктов справедливо все то, что сказано абзацем выше – средств дадут меньше и под условия похуже. Потому стимул получить кредит якобы на приобретение недвижимости все-же существует.\n\n«Ситуация чрезвычайно редчайшая, - говорит Марина Мишурис (ФлексБанк). – Вспоминается только один подобный случай. Тогда продавец и покупатель, как выяснилось, были в родственных отношениях – и появилось подозрение, что сделка купли-продажи по сути фиктивная, а деньги будут использованы на личные цели. Кредит в результате выдан не был, и проверить эту догадку эмпирически не удалось. А вообще, отсутствие схожих отношений является обязательным условием для ипотечного кредита». «С таковыми случаями мы не сталкивались», - подтверждает Лена Ковырзина, директор департамента кредитования розничного бизнеса и МСБ Абсолют Банка. Совместно с тем эксперт соглашается, что если представить, что обладатель квартиры и «покупатель» условились таким образом обмануть банк и получить дешевенький кредит, отследить эту схему тяжело. Хотя в данном случае у банка остается залог, на который в случае просрочки по кредиту можно обратить взыскание\n\nВ общем, в большинстве случаев подобные аферы строятся на том, что клиент и торговец – родственники. И разработка защиты банков традиционно максимально проста – не кредитовать сделки, в которых меж сторонами имеется родство.\nНовостройки А101\nНовая Москва.15 минут до 3 веток метро. Широкий выбор квартир. 214-ФЗ. Успейте приобрести по выгодной стоимости! квартиры от 2,5 млн рублей! А101 Девелопмент Выяснить телефон\n\nПопытка скрыть обременение квартиры\nВ отличие от иных приведенных в данной статье приемов (которые, строго говоря, мошенничество, но на бытовом уровне вроде как понятны и извинительны – ну, приписал для себя человек тыщ 15 ежемесячной заработной платы) это уже самая настоящая уголовщина. Сущность сводится к тому, чтоб скрыть факт того, что квартира находится под обременением – и получить под нее 2-ой (а ежели получится – то и 3-ий, четвертый…) кредит. Честно скажем, о схожем мы слышали мало – но в интернете какие-то отголоски отыскать удалось.\n\nБольшая часть наших экспертов дружно заявили, что это в принципе нереально. Как справедливо отметила Сабина Хамитова, управляющий департамента ипотеки компании «Домус финанс», любые сделки с недвижимостью подлежат неотклонимой государственной регистрации и при ипотеке в Единый государственный реестр прав (ЕГРП) вносится пометка о обременении. А банк, выдавая ипотечный кредит, непременно проверит юридическую чистоту – в том числе возьмет выписку из ЕГРП.\n\nНо Евгений Вальков («Экспресс-Кредит») сообщил, что один раз встречался с попыткой подобного мошенничества: она строилась на том, что свидетельство о принадлежности и остальные документы из ЕГРП были подделаны. Соответственно, пресечено мошенничество оказалось тогда, когда сотрудники банка без помощи других обратились в Росреестр.\n\n<a href=http://seditionfm.xyz/gde-mojno-vzyat-desheviy-kredit