1159	Eduardfaurf	eduardyudaev4@mail.ru		Volvo in Kiev	Обслуживание насоса муфты Haldex 5-го поколения\nВ современных полноприводных автомобилях Вольво применяется муфта Haldex 5-го поколения. Она срабатывает быстрее, четко определяя требуемый крутящий момент для задней оси, в отличии от муфт предыдущего поколения. Модернизации полного привода улучшили поведение Вольво серии ХС на любом дорожном покрытии.\nКонструктивно муфта Халдекс 5-го поколения изменилась. В муфте теперь отсутствует масляный фильтр. С точки зрения эксплуатации возникает необходимость в дополнительном обслуживании масляного насоса. В процессе эксплуатации в муфте Халдекс происходит изнашивание фрикционов, а также трущихся поверхностей. Эти микрочастицы смываются маслом и попадают на заборную сетки масляного насоса. Со временем, когда сетка активно забивается, увеличивается износ насоса и падает давление в масляной системе. Полный привод начинает отключаться и загорается сообщение о неисправности полного привода.\nОбслуживание насоса муфты Haldex 5-го поколенияОбслуживание насоса муфты Haldex 5-го поколения\nОбслуживание насоса муфты Haldex 5-го поколенияОбслуживание насоса муфты Haldex 5-го поколения\nОбслуживание насоса муфты Haldex 5-го поколенияОбслуживание насоса муфты Haldex 5-го поколения\nПрофилактика масляного насоса предполагает следующие этапы:\nдемонтаж масляного насоса муфты Халдекс\nочистка заборной сетки\nслив масла и промывку масляного канала\nустановка масляного насоса\nзалив новой жидкости в муфту.\nПодобная профилактика существенно продлевает срок службы масляного насоса. Если у Вас уже начали загораться сообщения о неисправности полного привода и фиксируются коды на насос Халдекс, то скорее всего уже придется его менять.\nотличия 4 и пятого поколения муфты\nПринцип работы\nОсновная часть муфты – блок управления. С его помощью проводят анализ данных со всех датчиков автомобиля. Когда формируется команда, которая относится к муфте, компьютер принимает во внимание все данные, касающиеся таких показателей, как пробуксовка колес, скорость, а также положение руля, поперечное ускорение, движение накатом или нагрузкой. Это нужно, чтобы система полного привода могла вовремя среагировать на то, что ситуация изменилась.\nмуфта и принцип работы\nНе очень правильно считать, что муфта подключает или невольно блокирует заднюю ось. Даже при идеальном сцеплении есть процент момента вращения, который передается на корму. Это примерно 10 %.\nТакая работа внатяжку нужна, чтобы система была готова распределить тягу между осями автомобиля равномерно или необходимым образом.\nПринцип работы муфты состоит в том, что момент вращения передается от двигателя к ведущим дискам. Ведомые диски соединены с приводом на задней оси. Электроника может отдать команду гидравлическим дискам на сжатие пакета дисков. Чем оно сильнее, тем больше тяги передается на заднюю ось тогда, когда передние колеса проскальзывают. Это процесс происходит очень плавно.\nСравним муфты 4-го и 5-го поколений. В чем разница\nВ новой разработке в основном были произведены изменения в гидравлической системе. До этого жидкость передавалась к кольцевому поршню под давлением 30 бар (это давление нагнетал электронасос) и была ограничена электромагнитным клапаном. Сила, с которой происходит сжатие дисков, напрямую зависит от объема жидкости, которая проходит через клапан, и номинала крутящего момента, который передается на задние колеса.\n4 поколение\nРаботает муфта 5-го поколения значительно быстрее.\nА может быть, зря облегчили?\nКонечно, сейчас почти все детали автомобиля становятся легче. Муфта была облегчена в основном потому, что из нее убрали масляный фильтр. При правильном уходе проблем с ней возникнуть не должно. Автовладелец должен менять масло в муфте примерно один раз за три года, когда он проехал 100 000 км. (Если он прошел это расстояние раньше, соответственно, масло нужно менять раньше). Если масло не менять, это может привести к серьезной поломке муфты. Ремонт обычно очень дорог, так что нет смысла рисковать и затягивать со сменой масла.\nТак что при правильной эксплуатации никаких проблем с новой муфтой «Халдекс» быть не должно. Ведь главное – не забывать вовремя менять в ней масло. Словом, муфта «Халдекс» была сделана в «облегченном формате» совсем не зря. Конечно, появились нюансы в использовании. Но плюсы такого усовершенствования значительно превышают минусы.\nСерийная установка муфты «Халдекс» на автомобили началась в 1998 году. Первыми автомобилями, на которые она была установлена, стали «Ауди» с полным приводом и автомобили Volkswagen (у них был поперечно расположенный двигатель).\nПрототипом муфты «Халдекс» можно назвать вискомуфту. Сейчас ее не устанавливают на автомобили по той причине, что она переводит тягу на заднюю ось не так быстро, как это требовалось.\nКак показывает практика, каждое новое поколение муфты «Халдекс» становится все лучше. Улучшается ее быстрота, надежность. Она становится более удобной и технологичной, компактной и легкой. Кроме того, она «умнеет». Сейчас ее устанавливают на многие автомобили, среди них такие марки, как Skoda, Cadillac. Кроме того, такая муфта используется на Buggatti, Audi, Opel, Ford, Volkswagen, LandRover и Volvo.<a href=https://www.saabvolvo.com.ua/>Cтанция технического обслуживания (СТО) "СААБ-ВОЛЬВО"в Киеве</a>	2017-07-08 01:45:06.587262+03	\N	\N	\N	1
